import React from "react";
import "./TitleBodyStyles.css";
function TitleBody(){
    return(
        <>
        <div class="TitleBody">
            <div class="TitleBodyEvemCont">
                <p class="TitleBodyEvem">EveM</p>
                <p class="TitleBodyEventMan">Event Management</p>
            </div>
        </div>
        <div class="r1">
        </div>
        </>
    )
}
export default TitleBody
